import React from 'react';
import { Paper, Typography, Avatar, Box, Button } from '@mui/material';

const DoctorSelection = () => {
  const doctors = [
    { name: 'Dr. Smith', avatar: '/path-to-avatar1.jpg' },
    { name: 'Dr. Johnson', avatar: '/path-to-avatar2.jpg' },
    { name: 'Dr. Williams', avatar: '/path-to-avatar3.jpg' },
    { name: 'Dr. Brown', avatar: '/path-to-avatar4.jpg' },
    { name: 'Dr. Jones', avatar: '/path-to-avatar5.jpg' },
  ];

  return (
    <Paper elevation={3} sx={{ p: 3, height: '300px' }}>
      <Typography variant="h5" gutterBottom>Choose your personal doctor</Typography>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', my: 2 }}>
        {doctors.map((doctor, index) => (
          <Avatar key={index} alt={doctor.name} src={doctor.avatar} sx={{ width: 56, height: 56 }} />
        ))}
      </Box>
      <Button variant="contained" fullWidth>See everyone</Button>
    </Paper>
  );
};

export default DoctorSelection;
